    data: |
      SELECT ALL + CAST ( - + col1 AS INTEGER ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( ( - col1 BETWEEN - CAST ( NULL AS INTEGER ) AND col1 * - CAST ( - 26 AS INTEGER ) ) );
  - name: tab0

outputs:
  - name: q4143.out
    data: |
